import React from 'react';
import { useParams } from 'react-router-dom';

const spaces = [
  { id: 1, name: 'Garage Espacioso', description: 'Espacio grande y seguro.', price: '$100/mes' },
  { id: 2, name: 'Almacén Seguro', description: 'Almacén con seguridad 24/7.', price: '$150/mes' },
  { id: 3, name: 'Espacio Premium', description: 'Ubicación céntrica y amplia.', price: '$200/mes' },
];

const SpaceDetails = () => {
  const { id } = useParams();
  const space = spaces.find((s) => s.id === parseInt(id));

  return (
    <div className="space-details">
      <h1>{space.name}</h1>
      <p>{space.description}</p>
      <p><strong>Precio:</strong> {space.price}</p>
    </div>
  );
};

export default SpaceDetails;
